import React from "react";

const Download = () => {
  return (
    <div className="down">
      <button className="btn btn-success">Download_CSV</button>
      <form>
        <label>
          Airway Bill
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};
export default Download;
